import React from 'react';
import { useMoralis } from "react-moralis";

import telegramIcon from "../assets/telegram.svg"
import twitterIcon from "../assets/twitter.svg"
import discordIcon from "../assets/discord.svg"

const Footer = ({ height, text }: any) => {
    const { authenticate, logout, isAuthenticated, user } = useMoralis();


    return (
        <footer>
            <section className="next bg-black h-80">
                <div className="grid grid-cols-3 gap-8">
                </div>

                <div className="flex flex-0 md:gap-80 gap-8 p-8 ">

                    <img src={discordIcon} alt="Discord server" className="w-12 h-12  md:text-1xl flex-1  z-10 font-semibold rounded-lg shadow-md text-black  h-12" />

                    <button className={"font-bold md:text-1xl bg-red-600 flex-1  z-10 font-semibold rounded-lg shadow-md text-black bg-black h-12"} onClick={() => null}>
                        <img src={twitterIcon} alt="" className="w-12 h-12" />
                    </button>
                    <button className={"font-bold md:text-1xl bg-red-600 flex-1  z-10 font-semibold rounded-lg shadow-md text-black bg-black h-12"} onClick={() => null}>
                        <img src={telegramIcon} alt="" className="w-12 h-12" />
                    </button>
                    <button className={"font-bold md:text-1xl bg-red-600 flex-1  z-10 font-semibold rounded-lg shadow-md text-black bg-black h-12"} onClick={() => null}>
                        <img src={discordIcon} alt="" className="w-12 h-12" />
                    </button>
                </div>
            </section>
        </footer>
    );
}
export default Footer;
